import axios from "axios";
import { useRef, useState, useEffect} from "react";
import infiniteScroll from 'infinite-scroll';
import './App.css';

export default function App() {
    const [results, setResults] = useState([])
    useEffect(() => {
      axios
        .get('./Foodsource.json?page=2&limit=50')
        .then(res => { 
          setResults(res.data)
        })
        .catch(e => { console.log(e)}) },[]);
        const displayData = results.map(
          (info)=> {
            return(
              <tr>
                <td>{info.resteraunt}</td>
                <td>{info.name}</td>
                <td>{info.people}</td>
                <td>{info.timetag}</td>
              </tr>
            )
          }
        )
        const ref = useRef();
        useEffect(() => {
          const row = document.querySelectorAll(".card")
          const observer = new IntersectionObserver(entries => {
            entries.forEach(entry => {
              entry.target.classList.toggle("show", entry.isIntersecting)
            })
          },
          {
            threshold: 0.8,
            rootMargin: "-75px",
          })
          row.forEach(val => {
            observer.observe(val)
          })
        })





  return (
    <div className="App">
      <div>
      <div class="card" ref={ref}> {displayData.slice(0,1)}</div>
      <div class="card" ref={ref}> {displayData.slice(1,2)}</div>
      <div class="card" ref={ref}> {displayData.slice(2,3)}</div>
      <div class="card" ref={ref}> {displayData.slice(3,4)}</div>
      <div class="card" ref={ref}> {displayData.slice(4,5)}</div>
      <div class="card" ref={ref}> {displayData.slice(5,6)}</div>
      <div class="card" ref={ref}> {displayData.slice(6,7)}</div>
      <div class="card" ref={ref}> {displayData.slice(7,8)}</div>
      <div class="card" ref={ref}> {displayData.slice(8,9)}</div>
      <div class="card" ref={ref}> {displayData.slice(9,10)}</div>
      <div class="card" ref={ref}> {displayData.slice(10,11)}</div>
      <div class="card" ref={ref}> {displayData.slice(11,12)}</div>
      <div class="card" ref={ref}> {displayData.slice(12,13)}</div>
      <div class="card" ref={ref}> {displayData.slice(13,14)}</div>
      <div class="card" ref={ref}> {displayData.slice(14,15)}</div>
      <div class="card" ref={ref}> {displayData.slice(15,16)}</div>
      <div class="card" ref={ref}> {displayData.slice(16,17)}</div>
      <div class="card" ref={ref}> {displayData.slice(17,18)}</div>
      <div class="card" ref={ref}> {displayData.slice(18,19)}</div>
      <div class="card" ref={ref}> {displayData.slice(19,20)}</div>
      <div class="card" ref={ref}> {displayData.slice(21,22)}</div>
      <div class="card" ref={ref}> {displayData.slice(23,24)}</div>
      </div>
    </div>


  );
}
